import './App.css';
import { Form, Col, Row } from 'react-bootstrap';
import React, { useState } from 'react';
import 'react-bootstrap-range-slider/dist/react-bootstrap-range-slider.css';
import RangeSlider from 'react-bootstrap-range-slider';

const axios = require('axios');


function App() {

  const [range, setRange] = useState(0);




  function handlePost() {

    const options = {
      method: 'POST',
      url: 'https://visningsrom.stacc.com/dd_server_laaneberegning/rest/laaneberegning/v1/nedbetalingsplan',
      headers: { 'Content-type': 'application/json' },
      data: {
        laanebelop: 2000000,
        nominellRente: 3,
        terminGebyr: 30,
        utlopsDato: "2025-01-01",
        saldoDato: "2020-01-01",
        datoForsteInnbetaling: "2020-02-01",
        ukjentVerdi: "TERMINBELOP"

      }
    }


    axios(options).then(function (response) {
      console.log(response)
      console.log(response.data.nedbetalingsplan)
    }).catch(function (error) {
      console.log(error);
    });

  }

  handlePost()

  return (
    <div className="App">
      <div className="App-header">
        Lånekalkulator
    </div>
      <div className="App-Laanekalkulator">
        <Form>
          <Form.Group as={Row}>
            <Form.Label>Lånebeløp</Form.Label>
              <RangeSlider
                value={range}
                onChange={e => setRange(e.target.value)}
                min={0}
                max={300000}
              />
            <Col xs="3">
              <Form.Control value={range} onChange={e => setRange(e.target.value)}/>
            </Col>
          </Form.Group>
        </Form>
      </div>


    </div>
  );
}

export default App;
